import React from "react";
import ReactDelayRender from "react-delay-render";
import FadeIn from "react-fade-in";

import ProjectItem from "./ProjectItem/ProjectItem";

import "./Projects.css";

const Projects = () => {
  return (
    <FadeIn>
      <div className="projects__wrapper">
        <p className="projects__paragraph">{/* maybe nothing? */}</p>
        <div className="projects__list">
          <ProjectItem triggerTitle="test" alt={"test"} img={""}>
            Here is a list of projects from the very beginning of my web
            development journey to the most recent utilising more advanced
            technologies.Here is a list of projects from the very beginning of
            my web development journey to the most recent utilising more
            advanced technologies.Here is a list of projects from the very
            beginning of my web development journey to the most recent utilising
            more advanced technologies.
          </ProjectItem>
        </div>
      </div>
    </FadeIn>
  );
};

export default ReactDelayRender({ delay: 401 })(Projects);
